import React from 'react';
import { Layout } from 'antd';
import Icon from './Icon';

const Header = () => {
  return (
      <Layout.Header>
        <Icon />
        <p style={{color: 'white'}}>Timeline de compras</p>
      </Layout.Header>
  );
};

export default Header;
